		let imgNum = 0;

		switch (sky + '') {
		case '1': // 맑음
			if (rainPer <= 50) {
				imgNum = 1;
			} else {
				imgNum = 27;
			}
			break;
		case '2': // 구름 조금
			if (rainPer <= 50) {
				imgNum = 3;
			} else {
				imgNum = 22;
			}
			break;
		case '3': // 구름많음
			if (rainPer <= 50) {
				imgNum = 5;
			} else if (rainPer <= 70) {
				imgNum = 25;
			} else {
				imgNum = 22;
			}
			break;
		case '4': // 흐림
			if (rainPer <= 50) {
				imgNum = 7;
			} else {
				if (rainAmount < 1) {
					imgNum = 8;
				} else if (rainAmount <= 20) {
					imgNum = 9;
				} else if (rainAmount <= 70) {
					imgNum = 10;
				} else {
					imgNum = 15;
				}
			}
			break;
		default:
			imgNum = 25;
		}

